import OrderedItems from "./OrderedItems";

function Orders(props) {
  const orderDetails = props.orderDetails.map((detail) => (
    <OrderedItems name={detail.name} price={detail.price} />
  ));

  return (
    <li>
      {orderDetails}
    </li>
  );
}
export default Orders;
